import React, {Component} from 'react';
import './navbar.css';
import logo from '../assets/Pictures/Yosemite National Park.png';
import { Link } from "react-scroll";
import {faBars, faX} from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';


class Navbar extends Component {
    state = {clicked: false};
    handleClick = () => {
        this.setState({
            clicked:!this.state.clicked
        })
    }

    render() {
    return (
        <nav>
            <img src={logo} alt='logo' className='logo'/>
            <div className="navbar" id="">
                <ul className="">
                    <li className="">
                        <Link to="/" className="nav__link">Yes </Link> 
                    </li>
                </ul>
            <div className="nav_close" id="nav-close">
                <FontAwesomeIcon icon={faX} />
            </div>
            </div>


            <div className="nav_toggle" onClick={this.handleClick}>
                <i id = "bar" className= {this.state.clicked ? 'fas fa-time' : 'fas fa-bars'}></i>
            </div>

            
        </nav>
    )
}
}

export default Navbar;
